import React from 'react';
import './App.css';
import TodoItem from './components/TodoItem';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      TodoItems: [
        { title: 'Get to work', isCompleted: true },
        { title: 'Go home', isCompleted: true },
        { title: 'Self study at home', isCompleted: true }
      ]
    };
  }
  render() {
    return (
      <div className="App">
        {this.TodoItems.map((item, index) => (
          <TodoItem key={index} item={item} />
        ))}
      </div>
    );
  }
}

export default App;
